import React from "react";
import "./Reviews.css";
import "../App.css";

function Reviews() {
  return (
    <>
      <div className="container">
        <div className="review-box">
          <div className="row">
          <div className="column">
            <p>some text here</p>
          </div></div>
        </div>
      </div>
    </>
  );
}

export default Reviews;
